"original": |2-
     The IPP object does not support or refuses to support the IPP version
     that was supplied as the value of the "version-number" operation
     parameter in the request.  The IPP object is indicating that it is
     unable or unwilling to complete the request using the same major and
     minor version number as supplied in the request, other than with this
     error message.  The error response SHOULD contain a "status-message"
     attribute (see Section 4.1.6.2) describing why that version is not
     supported and what other versions are supported by that IPP object.
     See Sections 4.1.6.1, 4.1.7, and 4.1.8.
"fixed": |-
  The IPP object does not support or refuses to support the IPP version that was supplied as the value of the "version-number" operation parameter in the request.  The IPP object is indicating that it is unable or unwilling to complete the request using the same major and minor version number as supplied in the request, other than with this error message.  The error response SHOULD contain a "status-message" attribute (see Section 4.1.6.2) describing why that version is not supported and what other versions are supported by that IPP object. See Sections 4.1.6.1, 4.1.7, and 4.1.8.
"ko": |-
  IPP 객체가 요청의 "version-number" 작업 매개변수 값으로 제공된 IPP 버전을 지원하지 않거나 지원을 거부합니다. IPP 객체는 이 오류 메시지 외에는 요청에 제공된 것과 동일한 주 버전 번호와 부 버전 번호를 사용하여 요청을 완료할 수 없거나 완료할 의사가 없음을 나타냅니다. 오류 응답에는 해당 버전이 지원되지 않는 이유와 해당 IPP 객체가 지원하는 다른 버전을 설명하는 "status-message" 속성(섹션 4.1.6.2 참조)이 포함되어야 합니다. 섹션 4.1.6.1, 4.1.7 및 4.1.8을 참조하십시오.
